import { Card, Button, Form } from 'react-bootstrap';
import './css.css';
function renderList(){
  let lst = this.state.listVote;
  const users = []
  for (let index = 0; index < lst.length; index++) {
    users.push(<h2>num is {index}</h2>);
  }
  return users;
}
